import classes from './Modal.module.scss'

const Modal = ({ selectedImage, setSelectedImage }) => {
  return (
    <div className={classes.modal} onClick={() => setSelectedImage(null)}>
      <img src={selectedImage} alt="selected_image" />
    </div>
  )
}

export default Modal
